VALUES ('8002190105871', 'Buoni così', 'zuccheri aggiunti con edulcoranti Ingredienti: farinee fiocchi di cereali 53% (grano tenero tipo 2 34%, grano farro 8% , avena 8 % , riso 3%, Sul prodotto finito), edulcoranti (maltitolo, sciroppo di maltitolo), olio di girasole alto oleico 12,5%, cruschello di frumento 5%, burro, amido di frumento, uova fresche 3%, fibra alimentare, latte scremato in polvere, siero di latte in polvere, agenti lievitanti (difosfato disodico, carbonato acido di sodio, carbonato acido di ammonio), sale marino integrale 0,3%, emulsionante: lecitina di girasole, aromi. AVVERTENZA PER ALLERGICI: può contenere sesamo, soia, nocciole e altra frutta a guscio, quindi non è idoneo al consumo da parte di soggetti allergici a tali sostanze. Contiene gli zuccheri naturalmente presenti nel latte (lattosio), impiegato per migliorare struttura, aspetto e sapore del prodotto. Lo zucchero (saccarosio) è assente. Un consumo eccessivo può avere effetti lassativi.', 'https://static.openfoodfacts.org/images/products/800/219/010/5871/front_it.4.400.jpg', '18', '4.1', '64.7', '2.5', '6', '7.7', '0.75', '0.295275590551181', '', '1');

